class ProjectCustomersRequestModel {  String? customerType;  String? search;  int? page;  ProjectCustomersRequestModel({this.customerType, this.search, this.page});  ProjectCustomersRequestModel.fromJson(Map<String, dynamic> json) {    customerType = json['customer_type'];    search = json['search'];    page = json['page'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['customer_type'] = this.customerType;    data['search'] = this.search;    data['page'] = this.page;    return data;  }}